Security fix: safeLoad() can hang when arrays with nested refs
used as key. Now throws exception for nested arrays. #475.

3.12.2 / 2019-02-26

Fix noArrayIndent option for root level, #468.

3.12.1 / 2019-01-05

Added noArrayIndent option, #432.




